import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

declare global {
  interface Window {
    languagePluginLoader: any
    app: App
  }
}

let console = "Initializing Python 3.8\n"

ReactDOM.render(
  <React.StrictMode>
    <p>Welcome to the Tic Tac Toe Neural Net! This project is currently under development.</p>
    <p>This is a Neural Net consisting of a single fully connected layer (no hidden layers) with a sigmoid activation function and cross-entropy loss</p>
    <App initialConsole = {console} />
  </React.StrictMode>,
  document.getElementById('root')
);


// doesn't work :(
window.languagePluginLoader.then(() => {
  window.app.updateConsole('Python Loaded!\n')
});
